// src/components/Dashboard/WeeklyProgress.js

import React from 'react';
import { Box, Typography, Divider } from '@mui/material';
import CampusMap from '../CampusMap'; // Import the CampusMap component

const WeeklyProgress = () => {
    return (
        <Box
            sx={{
                mt: 4,
                position: 'relative', // Enable stacking of elements
                height: '50vh', // Occupy the bottom half of the screen
            }}
        >
            {/* Map Background */}
            <Box
                sx={{
                    position: 'absolute',
                    top: 0,
                    left: 0,
                    right: 0,
                    bottom: 0,
                    zIndex: 0, // Ensure it stays behind other content
                }}
            >
                <CampusMap />
            </Box>

            {/* Weekly Progress Content */}
            <Box
                sx={{
                    position: 'relative',
                    zIndex: 1, // Ensure it appears on top of the map
                    bgcolor: 'rgba(255, 255, 255, 0.8)', // Semi-transparent white background
                    borderRadius: 1,
                    p: 2,
                }}
            >
                <Typography variant="h6" gutterBottom>
                    Weekly Progress
                </Typography>
                <Divider sx={{ mb: 2 }} />
                <Box sx={{ display: 'flex', justifyContent: 'space-between' }}>
                    <Box sx={{ width: '48%', bgcolor: '#f9f9f9', p: 2 }}>Assignments Assigned</Box>
                    <Box sx={{ width: '48%', bgcolor: '#f9f9f9', p: 2 }}>Completion Rate</Box>
                </Box>
            </Box>
        </Box>
    );
};

export default WeeklyProgress;
